    "Super Micro-Cool: Forced Boiling in a Micro-channel Pumped Fluid Loop Project",nt"tracking_summary":
    {ntt"total": 4,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T15:24:22.190100",nt"name": "super-micro-cool-forced-boiling-in-a-micro-channel-pumped-fluid-loop-project",nt"isopen":
    true,nt"url": null,nt"notes": "&lt;p&gt;Two-phase heat rejection offers
    vast potential in reducing the thermal control footprint of vehicles and equipment
    in terms of mass, volume, and parasitic power loss. This potential follows from
    the latent heat associated with phase change: in order to remove the same heat as
    a single phase water loop having a 20C temperature rise, a two-phase loop needs
    only 5&#37; the flow rate, and consequently 3 orders of magnitude lesser pumping
    power, while simultaneously providing a constant heat rejection temperature.&lt;br
    /&gt;A key issue in consideration of two-phase, however, is predicting behavior
    in partial and micro-gravity environments. Recent research indicates that the performance
    of forced boiling in constrained channels, e.g. micro-channels or micro- heat exchangers,
    is not affected by the presence or lack of gravity. This is a consequence of a characteristic
    length scale small enough that surface tension forces dominate flow behavior rather
    than buoyancy forces which dominate at conventional scales. This project proposes
    to demonstrate a pumped two-phase cooling loop, e.g. one that collects heat from
    heat sources through forced micro-channel boiling, mitigating unknowns of microgravity
    boiling, and does not employ a compressed vapor phase.&lt;br /&gt;&amp;nbsp;&lt;/p&gt;",nt"license_title":
